class Solution:
    def jump(self, nums) -> int:
        if len(nums) < 2:
            return 0
        steps = 0
        i = 0
        while i + nums[i] < len(nums) - 1:
            max_next_step = 0
            k = i
            for j in range(i,i + nums[i] + 1):
                if max_next_step < j + nums[j]:
                    k = j
                    max_next_step = j + nums[j]
            i = k
            steps += 1
        return steps + 1

sol = Solution()
print(sol.jump([2,0,2,4,6,0,0,3]))#3

print(sol.jump([1,2]))#1
print(sol.jump([1]))#0
